      sourcesContent: ["/**\n * @description \u4E0B\u62C9\u5217\u8868 class\n */\n\nimport $, { DomElement } from '../../utils/dom-core'\nimport DropListMenu from './DropListMenu'\nimport { EMPTY_FN } from '../../utils/const'\n\nexport type DropListItem = {\n    $elem: DomElement\n    value: string\n}\n\n// droplist \u7684\u914D\u7F6E\u6570\u636E\nexport type DropListConf = {\n    title: string\n    list: DropListItem[]\n    type: string // 'list' \u5217\u8868\u5F62\u5F0F\uFF08\u5982\u201C\u6807\u9898\u201D\u83DC\u5355\uFF09\uFF1B 'inline-block' \u5757\u72B6\u5F62\u5F0F\uFF08\u5982\u201C\u989C\u8272\u201D\u83DC\u5355\uFF09\n    clickHandler: (value: DropListItem['value']) => void\n    width: number | 100\n}\n\nclass DropList {\n    private menu: DropListMenu\n    private conf: DropListConf\n    private $container: DomElement\n    private rendered: boolean\n    private _show: boolean\n\n    public hideTimeoutId: number\n    public showTimeoutId: number\n\n    constructor(menu: DropListMenu, conf: DropListConf) {\n        this.hideTimeoutId = 0\n        this.showTimeoutId = 0\n        this.menu = menu\n        this.conf = conf\n\n        // \u5BB9\u5668\n        const $container = $('<div class=\"w-e-droplist\"></div>')\n\n        // \u6807\u9898\n        const $title = $(`<p>${conf.title}</p>`)\n        $title.addClass('w-e-dp-title')\n        $container.append($title)\n\n        // \u5217\u8868\u548C\u7C7B\u578B\n        const list = conf.list || []\n        const type = conf.type || 'list'\n        // item \u7684\u70B9\u51FB\u4E8B\u4EF6\n        const clickHandler = conf.clickHandler || EMPTY_FN\n\n        // \u52A0\u5165 DOM \u5E76\u7ED1\u5B9A\u4E8B\u4EF6\n        const $list = $('<ul class=\"' + (type === 'list' ? 'w-e-list' : 'w-e-block') + '\"></ul>')\n        list.forEach(item => {\n            const $elem = item.$elem\n\n            const value = item.value\n            const $li = $('<li class=\"w-e-item\"></li>')\n            if ($elem) {\n                $li.append($elem)\n                $list.append($li)\n                $li.on('click', () => {\n                    clickHandler(value)\n\n                    // item \u70B9\u51FB\u4E4B\u540E\uFF0C\u9690\u85CF list\n                    this.hideTimeoutId = window.setTimeout(() => {\n                        this.hide()\n                    })\n                })\n            }\n        })\n        $container.append($list)\n\n        // \u7ED1\u5B9A\u9690\u85CF\u4E8B\u4EF6\n        $container.on('mouseleave', () => {\n            this.hideTimeoutId = window.setTimeout(() => {\n                this.hide()\n            })\n        })\n\n        // \u8BB0\u5F55\u5C5E\u6027\n        this.$container = $container\n        this.rendered = false\n        this._show = false\n    }\n\n    /**\n     * \u663E\u793A DropList\n     */\n    public show() {\n        if (this.hideTimeoutId) {\n            // \u6E05\u9664\u4E4B\u524D\u7684\u5B9A\u65F6\u9690\u85CF\n            clearTimeout(this.hideTimeoutId)\n        }\n\n        const menu = this.menu\n        const $menuELem = menu.$elem\n        const $container = this.$container\n        if (this._show) {\n            return\n        }\n        if (this.rendered) {\n            // \u663E\u793A\n            $container.show()\n        } else {\n            // \u52A0\u5165 DOM \u4E4B\u524D\u5148\u5B9A\u4F4D\u4F4D\u7F6E\n            const menuHeight = $menuELem.getSizeData().height || 0\n            const width = this.conf.width || 100 // \u9ED8\u8BA4\u4E3A 100\n            $container.css('margin-top', menuHeight + 'px').css('width', width + 'px')\n\n            // \u52A0\u5165\u5230 DOM\n            $menuELem.append($container)\n            this.rendered = true\n        }\n\n        // \u4FEE\u6539\u5C5E\u6027\n        this._show = true\n    }\n\n    /**\n     * \u9690\u85CF DropList\n     */\n    public hide() {\n        if (this.showTimeoutId) {\n            // \u6E05\u9664\u4E4B\u524D\u7684\u5B9A\u65F6\u663E\u793A\n            clearTimeout(this.showTimeoutId)\n        }\n\n        const $container = this.$container\n        if (!this._show) {\n            return\n        }\n        // \u9690\u85CF\u5E76\u9700\u6539\u5C5E\u6027\n        $container.hide()\n        this._show = false\n    }\n\n    public get isShow() {\n        return this._show\n    }\n}\n\nexport default DropList\n"]
