      sourcesContent: ["/**\n * @description \u94FE\u63A5 \u83DC\u5355\n * @author wangfupeng\n */\n\nimport PanelMenu from '../menu-constructors/PanelMenu'\nimport Editor from '../../editor/index'\nimport $ from '../../utils/dom-core'\nimport createPanelConf from './create-panel-conf'\nimport isActive from './is-active'\nimport Panel from '../menu-constructors/Panel'\nimport { MenuActive } from '../menu-constructors/Menu'\nimport bindEvent from './bind-event/index'\n\nclass Link extends PanelMenu implements MenuActive {\n    constructor(editor: Editor) {\n        const $elem = $('<div class=\"w-e-menu\"><i class=\"w-e-icon-link\"></i></div>')\n        super($elem, editor)\n\n        // \u7ED1\u5B9A\u4E8B\u4EF6\uFF0C\u5982\u70B9\u51FB\u94FE\u63A5\u65F6\uFF0C\u53EF\u4EE5\u67E5\u770B\u94FE\u63A5\n        bindEvent(editor)\n    }\n\n    /**\n     * \u83DC\u5355\u70B9\u51FB\u4E8B\u4EF6\n     */\n    public clickHandler(): void {\n        const editor = this.editor\n        let $linkElem\n\n        if (this.isActive) {\n            // \u83DC\u5355\u88AB\u6FC0\u6D3B\uFF0C\u8BF4\u660E\u9009\u533A\u5728\u94FE\u63A5\u91CC\n            $linkElem = editor.selection.getSelectionContainerElem()\n            if (!$linkElem) {\n                return\n            }\n\n            // \u5F39\u51FA panel\n            this.createPanel($linkElem.text(), $linkElem.attr('href'))\n        } else {\n            // \u83DC\u5355\u672A\u88AB\u6FC0\u6D3B\uFF0C\u8BF4\u660E\u9009\u533A\u4E0D\u5728\u94FE\u63A5\u91CC\n            if (editor.selection.isSelectionEmpty()) {\n                // \u9009\u533A\u662F\u7A7A\u7684\uFF0C\u672A\u9009\u4E2D\u5185\u5BB9\n                this.createPanel('', '')\n            } else {\n                // \u9009\u4E2D\u5185\u5BB9\u4E86\n                this.createPanel(editor.selection.getSelectionText(), '')\n            }\n        }\n    }\n\n    /**\n     * \u521B\u5EFA panel\n     * @param text \u6587\u672C\n     * @param link \u94FE\u63A5\n     */\n    private createPanel(text: string, link: string): void {\n        const conf = createPanelConf(this.editor, text, link)\n        const panel = new Panel(this, conf)\n        panel.create()\n    }\n\n    /**\n     * \u5C1D\u8BD5\u4FEE\u6539\u83DC\u5355 active \u72B6\u6001\n     */\n    public tryChangeActive() {\n        const editor = this.editor\n        if (isActive(editor)) {\n            this.active()\n        } else {\n            this.unActive()\n        }\n    }\n}\n\nexport default Link\n"]
